import React from 'react';
import { PayPalButton } from "react-paypal-button-v2";

function Paypacheckout(props) {
    const paypay = props;
    return (
        <div>
            <PayPalButton
                options={{
                    clientId: "AW-8TpxiCTLOVHn0PSanGmaWyn0nsrTQpmd45_T6E3cszcTPCHT3gNqcmoGCzGDYRvOFmRgedIw9M5Sg",
                    currency: "VN"
                }}
                amount="111"
                onSuccess={(details, data) => {
                    alert("Transaction completed by " + details.payer.name.given_name);

                    return fetch("/paypal-transaction-complete", {
                        method: "post",
                        body: JSON.stringify({
                            orderId: data.orderID
                        })
                    });
                }}
            />
        </div>
    );
}

export default Paypacheckout;
